PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE Locations (
    matricule VARCHAR(9),
    vehicule VARCHAR(32),
    prix_unit DOUBLE DEFAULT 0.0,
    cin VARCHAR(10),
    client VARCHAR(32),
    tel VARCHAR(16),
    date_location DATE,
    date_retour DATE,
    jours INTEGER DEFAULT 0,
    prix_a_payer DOUBLE DEFAULT 0.0
);
COMMIT;
